import './App.css';
import io from "socket.io-client";

const socket = io("http://localhost:4000");

function App() {
  return (
    <div className="App">
      <form>
        <input type="text" placeholder="Enter your name" />
        <button type="submit">Join</button>
      </form>
    </div>
  );
}

export default App;
